import React from 'react'
import './Contant.css'
import line from '../../assest/line.png'
// import arrow from '../../assest/arrow_icon.png'
const Contant = () => {
  return (
    <div className='Contant'>

      <div className="content_title">
        <h1>Get in touch</h1>
        <img src={line} alt="line img" />
      </div>

    </div>
  )
}

export default Contant
